  @staticmethod  
  def make_material(iso, masses, density=None):
    for m in range(len(masses)):
      masses[m] = float(masses[m])
    tm = sum(masses)
    for m in range(len(masses)):
      masses[m] = masses[m] * (100 / tm)

    mat = {}
    for i in range(len(iso)):
      symbol, nucleons = isotopes.split_symbol_nucleons(iso[i])
      if(symbol in isotopes.elements.keys()):
        protons = isotopes.elements[symbol]
        
        if(nucleons == None):
          s = isotopes.get_element(protons)
          for m in s['stable'].keys():
            protons = s['stable'][m]['protons'] 
            nucleons = s['stable'][m]['nucleons'] 
            percentage = s['stable'][m]['percentage'] 
            m = isotopes.get_isotope_mass(protons, nucleons)
            
            key = 1000 * protons + nucleons
            
            if(key not in mat.keys()):
              mat[key] = {
                         'key': key,
                         'protons': protons,
                         'nucleons': nucleons,
                         'isotope_percentage': percentage,
                         'mass_percentage': percentage * (masses[i] / 100),
                         'isotope_amu': m,
                         'isotope_kg_per_m3': 0.0,
                         'atoms_per_m3': 0.0,
                         }
            else:
              mat[key]['mass_percentage'] = mat[key]['material_percentage'] + percentage * (masses[i] / 100)
        else:    
          s = isotopes.get_isotope(protons, nucleons)  
          m = isotopes.get_isotope_mass(protons, nucleons)
          key = 1000 * protons + nucleons
          if(key not in mat.keys()):
            mat[key] = {
                       'key': key,
                       'protons': protons,
                       'nucleons': nucleons,
                       'isotope_percentage': s['percentage'],
                       'mass_percentage': masses[i],
                       'isotope_amu': m,
                       'isotope_kg_per_m3': 0.0,
                       'atoms_per_m3': 0.0,
                       }
          else:
            mat[key]['mass_percentage'] = mat[key]['material_percentage'] + masses[i]
    
    # Calculate number percentage of each isotope
    s = 0.0
    for key in mat.keys():
      m = isotopes.get_isotope_mass(mat[key]['protons'], mat[key]['nucleons'])
      s = s + mat[key]['mass_percentage'] / m      
    for key in mat.keys():
      m = isotopes.get_isotope_mass(mat[key]['protons'], mat[key]['nucleons'])
      mat[key]['number_percentage'] = ((mat[key]['mass_percentage'] / m) / s) * 100
      
    # Number Density
    if(density is not None): 
      for key in mat.keys():
        mat[key]['isotope_kg_per_m3']  = (mat[key]['mass_percentage'] / 100) * density
        mat[key]['atoms_per_m3'] = mat[key]['isotope_kg_per_m3'] / (mat[key]['isotope_amu'] * 1.6605402e-27)
    return mat
 
  @staticmethod  
  def split_symbol_nucleons(inp):
    alpha = 'abcdefghijklmnopqrstuvwxyz'
    num = '0123456789'
    inp = inp.lower()
    
    symbol = ''
    nucleons = ''
    for c in inp:
      if(c in alpha):
        symbol = symbol + c
      elif(c in num):
        nucleons = nucleons + c
    if(len(nucleons) > 0):
      nucleons = int(nucleons)
    else:
      nucleons = None
    return symbol, nucleons
  
  
      
