  @staticmethod
  def get_decay_chain(protons, nucleons):  
    # Chains stored in a grid - find the size of grid
    isotopes.chain_x = 0
    isotopes.chain_y = 0   
    isotopes.make_chain(protons, nucleons, False)    
    isotopes.chain = []
    for i in range(isotopes.chain_x):
      row = []
      for j in range(isotopes.chain_y):
        row.append(None)
      isotopes.chain.append(row)      
    tree_width = isotopes.chain_y
    tree_height = isotopes.chain_x      
    # Fill grid step 1  
    isotopes.chain_x = 0
    isotopes.chain_y = 0
    isotopes.chain[0][0] = [protons, nucleons, None, None,1]
    isotopes.make_chain(protons, nucleons, True)    
    # Fill grid part 2
    for j in range(tree_width):
      for i in range(tree_height):
        if(j > 0 and isotopes.chain[i][j] == None):
          isotopes.chain[i][j] = list.copy(isotopes.chain[i][j-1])
          isotopes.chain[i][j][-1] = 0          
    # Organise chains
    chains = []
    for j in range(tree_width):
      chain = []
      for i in range(tree_height):
        chain.append(isotopes.chain[i][j])
      chains.append(chain) 
    # Fill decay constant  
    for i in range(len(chains)):
      for j in range(len(chains[i])-1):
        dc = isotopes.get_decay_constant(chains[i][j][0],chains[i][j][1])
        chains[i][j][2] = dc
    # Fill decay chance / branching chance
    for i in range(len(chains)):
      for j in range(len(chains[i])-1):
        dc = isotopes.get_decay_constant(chains[i][j][0],chains[i][j][1])
        chains[i][j+1][3] = isotopes.get_branch_chance(chains[i][j][0], chains[i][j][1], chains[i][j+1][0], chains[i][j+1][1])
    return chains
    
   
  @staticmethod
  def make_chain(protons, nucleons, store=False, l=0):
    # Get isotope details
    s = isotopes.get_isotope(protons, nucleons)
    if(store):
      isotopes.chain[l][isotopes.chain_y] = [protons, nucleons, None, None, 1]
    l = l + 1    
    if(l > isotopes.chain_x):
      isotopes.chain_x = l    
    if(s['stability'] == 'stable'):
      isotopes.chain_y = isotopes.chain_y + 1
      return ''
    else:
      dm = isotopes.get_decay_modes(protons,nucleons)
      if(dm == None):
        isotopes.chain_y = isotopes.chain_y + 1
        return ''
      else:
        for d in dm:            
          isotopes.make_chain(d['protons'], d['nucleons'], store, l)
        
        
  @staticmethod  
  def unique_chain_isotopes(protons, nucleons, unique_isotopes=None):
    if(unique_isotopes == None):
      unique_isotopes = []
    s = isotopes.get_isotope(protons, nucleons)
    if([protons, nucleons] not in unique_isotopes):
      unique_isotopes.append([protons, nucleons])
    if(s['stability'] == 'stable'):
      return unique_isotopes
    else:
      dm = isotopes.get_decay_modes(protons,nucleons)
      if(dm == None):
        return unique_isotopes
      else:
        for d in dm:            
          unique_isotopes = isotopes.unique_chain_isotopes(d['protons'], d['nucleons'], unique_isotopes)
        return unique_isotopes
        
        
